using System;using System.Collections;using System.Collections.Generic;using System.Reflection;using UnityEngine;// Inject means setting the value equal to a previously generated valuepublic abstract class Inject : Generate {	public override void FillIn(object obj, MemberInfo memberInfo) {		var memberType = GetMemberType(memberInfo);		SetMember(obj, memberInfo, GetFillValue(memberType));	}	public abstract object GetFillValue(Type t);}